import {
  Box,
  Heading,
  HStack,
  Image,
  Spacer,
  Stack,
  Text,
  VStack,
} from "@chakra-ui/react";

const Home = () => {
  return (
    <Stack spacing="15%" ml="10" direction="row">
      <VStack mt="15%" align="flex-start" spacing="10%">
        <Heading as="h1" size="4xl">
          the best casting <br /> agent
        </Heading>
        <Text fontSize="2xl">we find the perfect cast for your movie</Text>
      </VStack>
      <Box>
        <Image
          mt="40%"
          boxSize="600px"
          objectFit="contain"
          src="pana.png"
        ></Image>
      </Box>
    </Stack>
  );
};

export default Home;
